    listOfGroup: (groupId, sort, {isActive, isGroupHidden, status}) => `/api/v0/user_roles/group/${groupId}?${jsonToQueryString({ sort, isActive, isGroupHidden, status })}`,
    listOfGroupType: (groupType, {status, isActive} = {}) => `/api/v0/user_roles/group-type/${groupType}?${jsonToQueryString({ status, isActive })}`,
    create: () => `/api/v0/user_roles`,
    update: (roleId) => `/api/v0/user_roles/${roleId}`,
